        for ( uint256 i = 0; i < regPlayers[_designNo].length; i++ ) {
            //if(designes[_designNo].phase==votingState.first){PROBABLY SHOULD BE CHANGED BY CONSIDERING ALSO SECOND VOTING STAGE
